五边形的内角和为 $(5-2)\times 180^\circ=540^\circ$，所以每个内角为 $540^\circ/5=108^\circ$。五边形的中心角为 $360^\circ/5=72^\circ$。因此，五边形必须旋转 $72^\circ$ 才能与原始位置重合。[asy]
size(100);
defaultpen(linewidth(0.7));
int i;
for(i=0;i<=4;++i)

{

draw(dir(72*i)--dir(72*(i+1)));

}
draw(dir(0)--dir(72)--dir(144)--dir(216)--dir(288)--dir(0));
[/asy]  $\boxed{72}$

We can subtract the numbers just as we do in base 10, but we must be careful to carry over correctly.  \[
\begin{array}{c@{}c@{}c@{}c}
& & 5 & 8_9 \\
- & 1 & 8_9 \\
\cline{2-4}
& & 4 & 1_9 \\
\end{array}
\] The answer is $\boxed{41_9}$.

首先，$AB$ 和 $CD$ 相交当且仅当 $A$、$B$、$C$ 和 $D$ 的排列顺序是 $ABCD$、$ADBC$、$ACBD$、$ACDB$、$BDAC$、$BADC$。$A$、$B$、$C$ 和 $D$ 的排列顺序共有 $4! = 24$ 种，所以$AB$ 和 $CD$ 相交的概率是 $\frac{6}{24} = \boxed{\frac{1}{4}}$。  [asy]
size(100);
defaultpen(linewidth(0.7));
draw(Circle((0,0),1));
pair A = dir(100);
pair B = dir(100+90);
pair C = dir(100+90+90);
pair D = dir(100+90+90+90);
dot(A); dot(B); dot(C); dot(D);
draw(A--B--C--D--cycle);
draw(A--C);
draw(B--D);
[/asy]

设铅笔的价格为 $x$ 分，大型橡皮擦的价格为 $y$ 分。根据题意，我们可以得到以下两个方程：
\begin{align*}
3x + y &= 124 \\
5x + y &= 182
\end{align*}
将两个方程相减，可以得到 $2x = 58$，即 $x = 29$。因此，铅笔的价格是 $\boxed{29}$ 分。

Martha 走的路是田地的周长的一半，所以她走了 $(300+400)\times 2/2=700$ 英尺。而 Jim 走的路是田地的对角线，长度为 $\sqrt{300^2+400^2}=500$ 英尺。所以 Jim 比 Martha 少走 $700-500=\boxed{200}$ 英尺。  [asy]
size(100);
draw((0,0)--(400,0)--(400,300)--(0,300)--cycle);
draw((0,0)--(300,400));
label("Martha",(200,150),W);
label("Jim",(150,200),N);
[/asy]
